import React from 'react'
import {ThemeProvider,createMuiTheme, makeStyles,Paper,Container} from '@material-ui/core'
import Navbar from './Navbar'
import logo from '../logo.svg'

const theme = createMuiTheme({
  palette: {
    type: 'dark'
  },

});

const useStyles = makeStyles((theme) => ({

	container:{
		padding:20,
		width:"100%",
		height:"100%",
		display:"flex"
	},
	img:{
		width:"100%",
		height:"100%"
	},
	box:{
		flex:1,
		marging:"20%"
	}
}))

export default function ChannelInfo(){
const classes = useStyles();


	return (
		<React.Fragment>
			<ThemeProvider theme={theme}>
			<Navbar/>
			<Container maxWidth="lg">
			<Paper className={classes.container}>
				<div classes={classes.box}>
				<img className={classes.img} src={logo}/>
				</div>
				<div classes={classes.box}>
					<h1>Channel Name</h1>
					<h5>discription</h5>
					<h5>country</h5>
					<h5>language</h5>
					<h5>content type</h5>

				</div>
				<div classes={classes.box}>
					<h1>Owner</h1>
					<h2>Date</h2>
				</div>
			</Paper>
			</Container>
			</ThemeProvider>
		</React.Fragment>
		)
}
